import img from "./../../images/imageNotFound.png";
import { AiFillDelete } from 'react-icons/ai';
import { useState } from "react";

import EmptyCart from "./../../components/emptyCart/EmptyCart";



const PurchaseList = ({items}) => {


    return ( 
        <main className="main">
        <div className="purchaseList">
            <button type="submit" className="purchase">Purchase</button>

            <span className="total__price__pur">Total price, $ 103{}</span>

            <div className="list__items">
            {items.map((item, index) => (
                <div className="single__li" key={index}>
                    <img src={img} alt ="" className="image__book__pur" />
                    <span className="book__name__pur">item.title}</span>
                    <span className="count__pur">Count</span>
                    <span className="single__price__pur">Price</span>
                    <AiFillDelete className="dlete__cart" />
                </div>
            ))}
            </div>
        </div>

        </main>
     );
}

export default PurchaseList;
